import React from 'react';
import styled from 'styled-components';

const NowLogoutS = styled.div`
  cursor: pointer;
  text-align : center;
  line-height : 36px;
  width: ${(props) => props.width};
  height: 36px;
  font-size: 16px;
  text-align: center;
  font-family:'bitbit';
  font-weight: 1;
  margin-left: ${(props) => props.marginLeft};
  margin-right: ${(props) => props.marginRight};
  color: ${(props) => props.color};
`;

function NowLogout() {
  return <>
    <>
      <NowLogoutS marginLeft="auto" color='rgb(0,0,0)'>마</NowLogoutS>
      <NowLogoutS color='rgb(50,50,50)'>이페이지</NowLogoutS>
    </>
    <>
      <NowLogoutS marginLeft="auto" color='rgb(0,0,0)'>좋</NowLogoutS>
      <NowLogoutS color='rgb(50,50,50)'>아요</NowLogoutS>
    </>
    <>
      <NowLogoutS marginLeft="auto" color='rgb(0,0,0)'>장</NowLogoutS>
      <NowLogoutS color='rgb(50,50,50)'>바구니</NowLogoutS>
    </>
    <>
      <NowLogoutS marginLeft="auto" color='rgb(0,0,0)'>로</NowLogoutS>
      <NowLogoutS color='rgb(50,50,50)'>그아웃</NowLogoutS>
    </>
  </>;
}

export default NowLogout;
